import axios from "axios";

class RoutesService {
  constructor() {
    this.service = axios.create({
      baseURL: "http://localhost:3010/",
      withCredentials: true
    })
  }

  createBid = (state) => {
    return this.service.post("/create/new-bid", {state})
    .then(response => response.data)
  }

}

export default RoutesService;
